import {Routes} from "@angular/router";
import {TournamentComponent} from "./tournament.component";


export const TOURNAMENT_ROUTES: Routes = [

  {
    path: ':id',
    component: TournamentComponent
  },
  {
    path: '',
    component
  }
];
